function req(method,path,body){
  return new Promise((res,rej)=>{
    const d=body?JSON.stringify(body):null;
    const r=https.request({hostname:"api.github.com",path,method,headers:{"Authorization":"token "+TOKEN,"User-Agent":"zm-push","Accept":"application/vnd.github.v3+json","Content-Type":"application/json",...(d?{"Content-Length":Buffer.byteLength(d)}:{})}},r=>{let s="";r.on("data",c=>s+=c);r.on("end",()=>{try{res({status:r.statusCode,body:JSON.parse(s)});}catch{res({status:r.statusCode,body:s})}});});
    r.on("error",rej);if(d)r.write(d);r.end();
  });
}
async function sha(fp){const r=await req("GET","/repos/"+OWNER+"/"+REPO+"/contents/"+fp);return r.status===200?r.body.sha:null;}
async function push(fp,b64,msg){
  for(let a=1;a<=3;a++){
    const s=await sha(fp);
    const body={message:msg,content:b64};
    if(s)body.sha=s;
    const r=await req("PUT","/repos/"+OWNER+"/"+REPO+"/contents/"+fp,body);
    if(r.status===200||r.status===201){console.log("OK "+fp);return true;}
    if(r.status===409){await new Promise(x=>setTimeout(x,2500*a));continue;}
    console.error("FAIL "+fp+" "+r.status+" "+JSON.stringify(r.body).slice(0,200));
    return false;
  }
  return false;
}

